import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import Avatar from '@material-ui/core/Avatar';
import Divider from '@material-ui/core/Divider';
import DeleteIcon from '@material-ui/icons/Delete';
import FireplaceIcon from '@material-ui/icons/Fireplace';
import WeekendIcon from '@material-ui/icons/Weekend';
import StorefrontIcon from '@material-ui/icons/Storefront';
import DirectionsIcon from '@material-ui/icons/Directions';

const useStyles = makeStyles((theme) => ({
  root: {
    width: '100%',
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
}));

export default function CardDivider(props) {
  const classes = useStyles();

  return (
    <List className={classes.root}>
      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <WeekendIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Amount of Benches" secondary={props.amountBenches} />
      </ListItem>
      <Divider variant="inset" component="li" />
      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <FireplaceIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Fire Places" secondary={props.amountFirePlaces} />
      </ListItem>
      <Divider variant="inset" component="li" />
      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <DeleteIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Trash Cans" secondary={props.amountTrashCans} />
      </ListItem>
      <Divider variant="inset" component="li" />
      <ListItem>
      <ListItemAvatar>
          <Avatar>
            <StorefrontIcon  />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Distance to next shop" secondary={props.distanceToNextShop} />
      </ListItem>
      <Divider variant="inset" component="li" />
      <ListItem>
      <ListItemAvatar>
          <Avatar>
            <DirectionsIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="directions" secondary={props.directions} />
      </ListItem>
      <Divider variant="inset" component="li" />
    </List>
  );
}
